INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (125801, 321, 1, 1, 2, 0, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, "リリ", 24001, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126001, 322, 2, 1, 2, 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, "クリア", 24001, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126101, 323, 3, 1, 2, 0, "んーと。\nこれ、あげる。\nはい", 1, "プレシア", 24001, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (125801, 324, 4, 2, 2, 0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, "リリ", 24001, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126001, 325, 5, 2, 2, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, "クリア", 24001, 40011);
INSERT INTO `v1_cce3142ebcfe22c552e272c0e47272ad03e3e504e96ab334797d2c8b55f4c47c` VALUES (126101, 326, 6, 2, 2, 0, "お兄。\nきてくれて、うれしい", 1, "プレシア", 24001, 40011);
